import {Text, StyleSheet, View} from "react-native";
import Form from "react";
import React from "react";


export default class Report extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            hours: '',
            munutes: '',
            revisits: '',
            studies: '',
            publications: '',
            videos: ' ',
            remarks: ' '
        }
    }

    render(){
        return <View>
            <Form>
                <input
                    className="Hours"
                    placeholder= "Horas"
                />
            </Form>
        </View>
    }
}
